import React from 'react'
import { Data } from './Data'
const App = () => {
  return (
    <div>
      <h1>Hello</h1>
      {Data.map((item, i) => (
        <div className='card-item'>
          <h2>{item.setup}</h2>
          <p>{item.punchline}</p>
        </div>
      ))}
    </div>
  )
}

export default App
